import * as React from "react";
import Button from "@mui/material/Button";
import Avatar from "@mui/material/Avatar";
import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";
import ListItemAvatar from "@mui/material/ListItemAvatar";
import ListItemButton from "@mui/material/ListItemButton";
import ListItemText from "@mui/material/ListItemText";
import DialogTitle from "@mui/material/DialogTitle";
import Dialog from "@mui/material/Dialog";
import PersonIcon from "@mui/icons-material/Person";
import AddIcon from "@mui/icons-material/Add";
import { Typography, CardMedia } from "@mui/material";
import { blue } from "@mui/material/colors";
import SampleImage2 from "../dawnload/sampleImage_dog.jpg";
import Grid from "@mui/material/Grid";
const emails = ["username@gmail.com", "user02@gmail.com"];

export interface SimpleDialogProps {
  open: boolean;
  imageValue: string;
  onClose: () => void;
}

function SimpleDialog(props: SimpleDialogProps) {
  const handleClose = () => {
    props.onClose();
  };

  return (
    <Dialog onClose={handleClose} open={props.open}>
      {
        <CardMedia
          component="img"
          image={props.imageValue}
          title={"スケジュール"}
          onClick={handleClose}
        />
      }
    </Dialog>
  );
}

export default function ImageDialog(props: any) {
  const [open, setOpen] = React.useState(false);
  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  return (
    <div>
      <Grid container>
        <CardMedia
          component="img"
          image={props.bookParam.image}
          title={"スケジュール" + props.bookParam.id}
          style={{ maxWidth: props.bookParam.sizePer + "%" }}
          onClick={handleClickOpen}
        />
      </Grid>
      <SimpleDialog
        imageValue={props.bookParam.image}
        open={open}
        onClose={handleClose}
      />
    </div>
  );
}
